import { useForm } from "react-hook-form";
import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
    const paperStyle={ padding: '50px 20px', width:300, margin:"20px auto"}
    return(
        <div className="home">
            <h2>Welcome to RTT Forms.</h2>
            <nav>
                <Link to="/create">
                    <button style={paperStyle}>Create New Webform</button>
                </Link>
                <br /><Link to="/browse">
                <button style={paperStyle}>Browse Created Webforms</button>
                </Link>
            </nav>
        </div>
        
    );
}

export default Home
